import {createSlice} from '@reduxjs/toolkit'

const initialState =[
    { id: '1', title: 'First Post!', content: 'Hello!' },
    { id: '2', title: 'Second Post', content: 'More text' }
]

const toDoTasksSlice = createSlice({
    name: 'toDoTasks',
    initialState,
    reducers:{}
})

export default toDoTasksSlice.reducer
